import React from "react";
import "./Navbar.css";

function Navbar() {
  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-light">
      <div>
        <h1>Peleas de Hockey</h1>
      </div>
    </nav>
  );
}

export default Navbar;
